import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];
export default function Header() {
  return (
    <div>
      {services_array.map(service => (
        <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
          <button style={linkStyle}>
            <span>{service}</span>
          </button>
        </Link>
      ))}
      <style jsx>{`
        div {
          background-image : url("../static/Waterfall-in-costa-rica.png")
        }
        `}</style>
    </div>
  )
}
